  `tlabel_status` int(11) NOT NULL DEFAULT 0 COMMENT '标签状态0=正常 1=暂停使用 2=删除 3= 待审核 4= 驳回',
  `tlabelor_class` int(11) NOT NULL COMMENT '0 = 分类 1=标签',
  `tlabel_class_name` varchar(400) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '分类名称',
  `tlabel_pool_type` int(11) DEFAULT NULL COMMENT '1= 个性标签 2=全局标签 3=科研标签',
  `tlabel_count` int(11) NOT NULL DEFAULT 0 COMMENT '使用次数',
  `tlabel_allow_remove` int(10) NOT NULL DEFAULT 0 COMMENT '是否允许删除0=是 1= 否',
  `tlabel_remark` varchar(400) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `INDEX_TLABELPOOLID`(`id`) USING BTREE COMMENT '主键索引',
  INDEX `INDEX_TLABELNAME`(`tlabel_name`) USING BTREE COMMENT '标签名称索引'
) ENGINE = InnoDB AUTO_INCREMENT = 214 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

