INSERT INTO `assemble_rule` VALUES (12, '测试', 0, '{\"fields\":[{\"field\":\"medorgname\",\"table\":\"med_reportdetail\",\"alias\":\"\"},{\"field\":\"medorgcode\",\"table\":\"med_reportdetail\",\"alias\":\"\"}],\"relation\":[{\"from\":\"medorgname\",\"fromTable\":\"med_reportdetail\",\"to\":\"medorgcode\",\"toTable\":\"med_reportdetail\",\"relat\":\"+\",\"relatCn\":\"加\"}]}', '[{\"table\":\"med_reportdetail\",\"alias\":\"\",\"join\":\"left join\",\"joinCn\":\"左\",\"joinField\":\"\"},{\"table\":\"med_report\",\"alias\":\"\",\"join\":\"\",\"joinCn\":\"\",\"joinField\":\"\"},{\"table\":\"med_reportdetail\",\"alias\":\"\",\"join\":\"left join\",\"joinCn\":\"左\",\"joinField\":\"\"},{\"table\":\"med_reportdetail\",\"alias\":\"\",\"join\":\"\",\"joinCn\":\"\",\"joinField\":\"\"}]', '[{\"filed\":\"medorgcode\",\"alias\":\"med_reportdetail\",\"oper\":\"=\",\"andOr\":\"\",\"value\":\"111\",\"type\":2,\"status\":1}]', 'SELECT med_reportdetail.medorgname +med_reportdetail.medorgcode FROM med_reportdetail  left join med_report  ON med_reportdetail.=med_report. WHERE med_reportdetail.medorgcode =111', 'dsf');
INSERT INTO `assemble_rule` VALUES (13, '标签1', 1, '{\"fields\":[{\"field\":\"medorgcode\",\"table\":\"med_reportdetail\",\"alias\":\"\"}],\"relation\":[]}', '[{\"table\":\"med_reportdetail\",\"alias\":\"\",\"join\":\"left join\",\"joinCn\":\"左\",\"joinField\":\"\"},{\"table\":\"med_report\",\"alias\":\"\",\"join\":\"\",\"joinCn\":\"\",\"joinField\":\"\"}]', '[{\"filed\":\"medorgcode\",\"alias\":\"med_reportdetail\",\"oper\":\"!=\",\"andOr\":\"or\",\"value\":\"111\",\"type\":2,\"status\":1}]', NULL, '标签1');
INSERT INTO `assemble_rule` VALUES (14, '标签测单表', 0, '{\"fields\":[{\"field\":\"medorgcode\",\"table\":\"med_reportdetail\",\"alias\":\"\"},{\"field\":\"medorgname\",\"table\":\"med_reportdetail\",\"alias\":\"\"}],\"relation\":[]}', '[{\"table\":\"med_reportdetail\",\"alias\":\"\",\"join\":\"\",\"joinCn\":\"\",\"joinField\":\"\"}]', '[{\"filed\":\"medorgname\",\"alias\":\"med_reportdetail\",\"oper\":\"=\",\"andOr\":\"or\",\"value\":\"安抚\",\"type\":1,\"status\":2}]', 'SELECT med_reportdetail.medorgcodemed_reportdetail.medorgname FROM  WHERE med_reportdetail.medorgname =\'安抚\' or ', '标签测单表');
INSERT INTO `assemble_rule` VALUES (15, '袁总让我提交的标签单表测试', 0, '{\"fields\":[{\"field\":\"medorgcode\",\"table\":\"med_reportdetail\",\"alias\":\"\"}],\"relation\":[]}', '[{\"table\":\"med_reportdetail\",\"alias\":\"\",\"join\":\"\",\"joinCn\":\"\",\"joinField\":\"\"}]', '[{\"filed\":\"medorgcode\",\"alias\":\"med_reportdetail\",\"oper\":\"=\",\"andOr\":\"or\",\"value\":\"111\",\"type\":2,\"status\":1},{\"filed\":\"medorgname\",\"alias\":\"med_reportdetail\",\"oper\":\"like\",\"andOr\":\"or\",\"value\":\"分\",\"type\":3,\"status\":2}]', 'SELECT med_reportdetail.medorgcode FROM  WHERE med_reportdetail.medorgcode =111 or med_reportdetail.to_char(medorgname, yyyy-mm-dd hh24:mi:ss) like\'分\'', '袁总让我提交的标签单表测试');
INSERT INTO `assemble_rule` VALUES (16, '最终测试版单表', 1, '{\"fields\":[{\"field\":\"medorgcode\",\"table\":\"med_reportdetail\",\"alias\":\"\"},{\"field\":\"medorgname\",\"table\":\"med_reportdetail\",\"alias\":\"\"}],\"relation\":[]}', '[{\"table\":\"med_reportdetail\",\"alias\":\"\",\"join\":\"\",\"joinCn\":\"\",\"joinField\":\"\"}]', '[{\"filed\":\"empiid\",\"alias\":\"med_reportdetail\",\"oper\":\"like\",\"andOr\":\"or\",\"value\":\"qwre\",\"type\":1,\"status\":1}]', 'SELECT med_reportdetail.medorgcode,med_reportdetail.medorgname FROM med_reportdetail  WHERE med_reportdetail.empiid like\'%qwre%\'', '最终测试版单表');
INSERT INTO `assemble_rule` VALUES (17, '单表like测试', 0, '{\"fields\":[{\"field\":\"medorgcode\",\"table\":\"med_report\",\"alias\":\"\"},{\"field\":\"medorgname\",\"table\":\"med_report\",\"alias\":\"\"}],\"relation\":[]}', '[{\"table\":\"med_report\",\"alias\":\"\",\"join\":\"\",\"joinCn\":\"\",\"joinField\":\"\"}]', '[{\"filed\":\"empiid\",\"alias\":\"med_report\",\"oper\":\"like\",\"andOr\":\"or\",\"value\":\"asf\",\"type\":1,\"status\":1}]', 'SELECT med_report.medorgcode,med_report.medorgname FROM med_report  WHERE med_report.empiid like \'%asf%\'', '单表like测试');
INSERT INTO `assemble_rule` VALUES (18, '测试聚合函数', 0, '{\"fields\":[{\"field\":\"medorgcode\",\"table\":\"med_reportdetail\",\"alias\":\"\"}],\"relation\":[{\"from\":\"medorgcode\",\"fromTable\":\"med_reportdetail\",\"to\":\"\",\"toTable\":\"\",\"relat\":\"sum\",\"relatCn\":\"求和\"}]}', '[{\"table\":\"med_reportdetail\",\"alias\":\"\",\"join\":\"\",\"joinCn\":\"\",\"joinField\":\"\"}]', '[{\"filed\":\"medorgcode\",\"alias\":\"med_reportdetail\",\"oper\":\"=\",\"andOr\":\"or\",\"value\":\"12\",\"type\":1,\"status\":1}]', 'SELECT sum(med_reportdetail.medorgcode) FROM med_reportdetail  WHERE med_reportdetail.medorgcode = \'12\'', '测试聚合函数');
INSERT INTO `assemble_rule` VALUES (19, 'ceshi111', NULL, '{\"fields\":[{\"field\":\"MedOrgCode\",\"table\":\"Fee_Inv\",\"alias\":\"\"},{\"field\":\"MedOrgName\",\"table\":\"Fee_Inv\",\"alias\":\"\"},{\"field\":\"MedOrgCode\",\"table\":\"NIS_Vitalsign\",\"alias\":\"\"}],\"relation\":[{\"from\":\"MedOrgCode\",\"fromTable\":\"Fee_Inv\",\"to\":\"MedOrgName\",\"toTable\":\"Fee_Inv\",\"relat\":\"+\",\"relatCn\":\"加\"},{\"from\":\"MedOrgName\",\"fromTable\":\"Fee_Inv\",\"to\":\"MedOrgCode\",\"toTable\":\"NIS_Vitalsign\",\"relat\":\"+\",\"relatCn\":\"加\"}]}', '[{\"table\":\"Fee_Inv\",\"alias\":\"\",\"join\":\"left join\",\"joinCn\":\"左\",\"joinField\":\"\"},{\"table\":\"NIS_Vitalsign\",\"alias\":\"\",\"join\":\"\",\"joinCn\":\"\",\"joinField\":\"\"}]', '[{\"filed\":\"MedOrgName\",\"alias\":\"Fee_Inv\",\"oper\":\"like\",\"andOr\":\"or\",\"value\":\"fsd \",\"type\":1,\"status\":1}]', 'SELECT Fee_Inv.MedOrgCode +,Fee_Inv.MedOrgName +,NIS_Vitalsign.MedOrgCode + FROM Fee_Inv  left join NIS_Vitalsign  ON Fee_Inv.=NIS_Vitalsign. WHERE Fee_Inv.MedOrgName like \'%fsd %\'', 'ceshi111');
INSERT INTO `assemble_rule` VALUES (20, '新增测试1', NULL, '{\"fields\":[{\"field\":\"MedOrgCode\",\"table\":\"NIS_Vitalsign\",\"alias\":\"\"}],\"relation\":[]}', '[{\"table\":\"NIS_Vitalsign\",\"alias\":\"\",\"join\":\"\",\"joinCn\":\"\",\"joinField\":\"\"}]', '[{\"filed\":\"MedOrgCode\",\"alias\":\"NIS_Vitalsign\",\"oper\":\"=\",\"andOr\":\"or\",\"value\":\"123\",\"type\":2,\"status\":1}]', 'SELECT NIS_Vitalsign.MedOrgCode FROM NIS_Vitalsign  WHERE NIS_Vitalsign.MedOrgCode =123', '新增测试1');
